import { ThemeProvider, useTheme } from 'emotion-theming'
import Button from '../components/Button'
import SomeText from '../components/SomeText'
import theme from '../theme'

function App() {
  return (
    <ThemeProvider theme={theme}>
      <Button theme={theme} />
      <SomeText>hello</SomeText>
    </ThemeProvider>
  );
}

export default App;
